    public class FTConnectionInterface
    {
        private string robotIP;
        private TcpClient tcpClient;
        private NetworkStream networkStream;
        private BinaryWriter binaryWriter;
        private BinaryReader binaryReader;

        public bool PortOpened { get; private set; }

        public FTConnectionInterface(string robotip)
        {
            robotIP = robotip;
        }


        public bool Connected()
        {
            if (tcpClient != null && tcpClient.Connected) return true;
            try
            {
                tcpClient = new TcpClient();
                tcpClient.ReceiveTimeout = 500;
                tcpClient.SendTimeout = 500;
                tcpClient.Connect(robotIP, 65000);
                networkStream = tcpClient.GetStream();
                binaryWriter = new BinaryWriter(networkStream);
                networkStream.ReadTimeout = -1;
                networkStream.WriteTimeout = -1;
                binaryReader = new BinaryReader(networkStream);
                PortOpened = true;
                return true;
            }
            catch (Exception)
            {
                PortOpened = false;
                return false;
            }
        }

        public void Disconnect()
        {
            try
            {
                binaryWriter.Close();
                tcpClient.Close();
            }
            catch { }
            PortOpened = false;
        }

        private void prepareProgramSending()
        {
            byte[] data;
            byte[] read;
            string datachain;

            // 4
            datachain = "9a2121dc";
            data = hexStreamToByteArray(datachain);
            binaryWriter.Write(data, 0, data.Length);

            // 6 antwort
            read = new byte[24];
            binaryReader.Read(read, 0, read.Length);


            // 7
            datachain = "6443f8da";
            data = hexStreamToByteArray(datachain);
            binaryWriter.Write(data, 0, data.Length);

            // 8 antwort
            read = new byte[20];
            binaryReader.Read(read, 0, read.Length);


            // 9
            datachain = "45ebd22c";
            data = hexStreamToByteArray(datachain);
            binaryWriter.Write(data, 0, data.Length);

            // 10 antwort
            read = new byte[240];
            binaryReader.Read(read, 0, read.Length);

            // 11
            datachain = "6443f8da";
            data = hexStreamToByteArray(datachain);
            binaryWriter.Write(data, 0, data.Length);

            // 12 antwort
            read = new byte[20];
            binaryReader.Read(read, 0, read.Length);
        }

        private void endProgramSending()
        {
            byte[] read;
            byte[] data;
            string datachain;

            // 28 antwort
            read = new byte[4];
            binaryReader.Read(read, 0, read.Length);

            // 29
            datachain = "8b95be21";
            data = hexStreamToByteArray(datachain);
            binaryWriter.Write(data, 0, data.Length);


            // 31
            read = new byte[8];
            binaryReader.Read(read, 0, read.Length);
        }

        public void SendAndStartProgram(List<byte[]> program)
        {
            prepareProgramSending();

            foreach (byte[] bytes in program)
            {
                binaryWriter.Write(bytes, 0, bytes.Length);
            }

            endProgramSending();
        }

        private byte[] hexStreamToByteArray(string hexStream)
        {
            byte[] data = new byte[hexStream.Length / 2];
            for (int i = 0; i < data.Length * 2; i += 2)
            {
                int value =
                    (int)new System.ComponentModel.Int32Converter().ConvertFromString("0x" + hexStream[i] + hexStream[i + 1]);
                data[i / 2] = (byte)value;
            }

            return data;
        }

        public InterfaceInformationPacket SendInterfacePacket(MotorMovement m1, MotorMovement m2,
            MotorMovement m3, MotorMovement m4)
        {
            return SendInterfacePacket(m1, 512, m2, 512, m3, 512, m4, 512);
        }

        public InterfaceInformationPacket SendInterfacePacket(MotorMovement m1, MotorMovement m2,
            MotorMovement m3, MotorMovement m4, bool resetC1 = false, bool resetC2 = false, bool resetC3 = false, bool resetC4 = false)
        {
            return SendInterfacePacket(m1, 512, m2, 512, m3, 512, m4, 512, resetC1, resetC2, resetC3, resetC4);
        }

        public InterfaceInformationPacket SendInterfacePacket(MotorMovement m1, int speed1, MotorMovement m2, int speed2, MotorMovement m3, int speed3, MotorMovement m4, int speed4, bool resetC1 = false, bool resetC2 = false, bool resetC3 = false, bool resetC4 = false)
        {
            byte[] sendPacket = new byte[60];
            sendPacket[0] = 0xba;
            sendPacket[1] = 0x97;
            sendPacket[2] = 0x35;
            sendPacket[3] = 0xcc;

            if (m1 == MotorMovement.LEFT)
            {
                int i = speed1 % 256;
                sendPacket[4] = (byte)i;
                sendPacket[5] = (byte)(speed1 / 256);
            }
            if (m1 == MotorMovement.RIGHT)
            {
                int i = speed1 % 256;
                sendPacket[6] = (byte)i;
                sendPacket[7] = (byte)(speed1 / 256);
            }

            if (m2 == MotorMovement.LEFT)
            {
                int i = speed2 % 256;
                sendPacket[8] = (byte)i;
                sendPacket[9] = (byte)(speed2 / 256);
            }
            if (m2 == MotorMovement.RIGHT)
            {
                int i = speed2 % 256;
                sendPacket[10] = (byte)i;
                sendPacket[11] = (byte)(speed2 / 256);
            }

            if (m3 == MotorMovement.LEFT)
            {
                int i = speed3 % 256;
                sendPacket[12] = (byte)i;
                sendPacket[13] = (byte)(speed3 / 256);
            }
            if (m3 == MotorMovement.RIGHT)
            {
                int i = speed3 % 256;
                sendPacket[14] = (byte)i;
                sendPacket[15] = (byte)(speed3 / 256);
            }

            if (m4 == MotorMovement.LEFT)
            {
                int i = speed4 % 256;
                sendPacket[16] = (byte)i;
                sendPacket[17] = (byte)(speed4 / 256);
            }
            if (m4 == MotorMovement.RIGHT)
            {
                int i = speed4 % 256;
                sendPacket[18] = (byte)i;
                sendPacket[19] = (byte)(speed4 / 256);
            }

            if (resetC1)
                sendPacket[44] = 0x01;
            if (resetC2)
                sendPacket[46] = 0x01;
            if (resetC3)
                sendPacket[48] = 0x01;
            if (resetC4)
                sendPacket[50] = 0x01;

            try
            {
                // Paket senden
                binaryWriter.Write(sendPacket, 0, 60);

                // Antwort lesen
                byte[] readBytes = new byte[72];
                binaryReader.Read(readBytes, 0, 72);
                return new InterfaceInformationPacket(readBytes);
            }
            catch (Exception)
            {
                return null;
            }
        }

        public InterfaceInformationPacket GetInterfaceInformation()
        {
            return SendInterfacePacket(MotorMovement.STOP, MotorMovement.STOP, MotorMovement.STOP, MotorMovement.STOP);
        }

